/** Returns a hash code value for this object.*/
@Override
public int hashCode() {
  int h = super.hashCode();
  h = 31 * h + slop;
  h = 31 * h + Arrays.hashCode(terms);
  h = 31 * h + Arrays.hashCode(positions);
  return h;
}

